import { StyleSheet, Text, View } from 'react-native';
import * as colors from '../utils/colors';

const viewNewDeck = () => {

    return (
        <View>
            <Text style={styles.header}>New Deck</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    header: {
        color: "red"
    }
})

export default viewNewDeck;
